import React from 'react';
import './css/TodoCss.css';
type TodoPorps = {
  form: string;
  todo: string;
}
const Todo: React.FC<TodoPorps> = ({form, todo}) => {
  return(
    <main className='todo-list'>
      <div className='title'>
      할 일 목록
      </div>
      <div className="list">
        <section className='forms'>
          날짜 : {form}
        </section>

        <div className = "Todo-Edit">
          <img className = "Todo-Edit-Img" src = "EditImg.png"/>
        </div>

        <section className='todos'>
          - 할 일<br/><span className="todo-text">{todo}</span>
        </section>
      </div>

    </main>
  )
};

export default Todo;
